webpackJsonp([0x7af4e6fc7393],{1113:function(A,e){A.exports={pathContext:{group:[{node:{id:"9fb543fe-da15-4070-ac8d-da5afcff6f06",title:"Chicagoland Half Marathon 2018",link:null,body:{value:"<p>Completed a soaking wet Chicagoland Half Marathon yesterday.  Finished 1:56:49.  About a minute and a half off of my best time, but far from my worst. Hoping for better weather next year.</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.8003341687552213,src:"/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-42807.jpg",srcSet:"/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-960f9.jpg 313w,\n/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-c36f2.jpg 625w,\n/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-42807.jpg 1250w,\n/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-dbc5e.jpg 1875w,\n/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-6e234.jpg 2500w,\n/static/70b98f0496180b635bb092547e0b3a61-615943a5c153779a3adb34af2689271e-8af24.jpg 2874w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/note/chicagoland-half-marathon-2018/"},post_type:"note",created:1526909009}},{node:{id:"2a497081-50c3-44c5-8cbb-60ddffc1bbc5",title:"My Struggle to Learn React - Brad Frost",link:"http://bradfrost.com/blog/post/my-struggle-to-learn-react/",body:{value:"<blockquote>I’m going to be honest: I’ve had a hell of a time getting my head around React. More than any other technology I’ve touched over the last 10 years of my career, I just haven’t had it click for me. It’s very frustrating as I really want to learn it, and it’s clear the library has legs.</blockquote>\r\n\r\n<p>I found React very difficult to learn the first time I attempted it. So much so that I actually just gave up and moved on to other things. Given that, I find Brad's honest take here extremely relatable (except for the part where Dan Abramov personally helped him through his React struggles.) And from a purely selfish perspective, knowing that a developer (sorry, frontend designer) that I admire had similar struggles with React makes me feel a bit better about myself.</p>\r\n\r\n<p>I still don't consider myself a React expert, but three specific things made it click for me:</p>\r\n\r\n<ul>\r\n<li>I know Brad threw some shade in his post, but <a href=\"https://reactforbeginners.com/\">Wes Bos' React for Beginners</a> just made a lot of sense to me when other tutorials didn't.</li>\r\n<li>I enforced what I learned by applying it to <a href=\"https://github.com/backlineint/aoty-visualizations\">a side project that I found legitimately interesting</a>.</li>\r\n<li>I eventually realized that I was trying to tackle things that were too complex. It wasn't until I focused on nailing some really basic stuff that things started to move fast and click. For me it was representing data in a table before I started trying to filter, sort, or otherwise visualize that data. For Brad it was <a href=\"http://bradfrost.com/blog/post/dumb-react/\">rendering a full page worth of mock components</a>.</li>\r\n</ul>\r\n\r\n<p>I'm glad I pushed through. Even though I have a lot to learn and a limited amount of time to do so, I really like React.</p> "},relationships:{image:null},fields:{slug:"/link/my-struggle-to-learn-react-brad-frost/"},post_type:"link",created:1526495549}},{node:{id:"5f95109e-e3bb-4bbd-aa24-ccfea36bd86b",title:"Recommended Pattern Lab Version and Edition for Drupal Integration",link:null,body:{value:'<p>Saw some useful clarification in the #pattern-lab channel on the <a href="http://drupaltwig-slack.herokuapp.com/">Drupaltwig slack</a> about which version and edition of Pattern Lab is recommended to use with Drupal going forward.</p>\r\n\r\n<ul>\r\n<li>As far as which repository to use,  <a href="https://www.drupal.org/u/evanlovely">EvanLovely</a> and <a href="https://github.com/sghoweri">Salem Ghoweri</a> clarified that we should be using the main Pattern Lab repository, not the Drupal fork that was previously active. Most if not all of the changes from the fork have been merged back into the main Pattern Lab repository.</li>\r\n<li>And regarding the edition, <a href="https://www.drupal.org/u/evanlovely">EvanLovely</a> somewhat surprisingly recommends the Twig edition over the Drupal edition. Apparently the differences are minimal, and "A true Drupal edition is better represented as a Drupal theme with the Twig edition integrated."</li>\r\n</ul>\r\n\r\n<p>So in summary, the next time you need Pattern Lab for a Drupal project, <a href="https://github.com/pattern-lab/edition-php-twig-standard">go here</a>.</p> \r\n\r\n<p>Helpful clarification given all of the Pattern Lab forks and editions floating around out there.</p>'},relationships:{image:null},fields:{slug:"/note/recommended-pattern-lab-version-and-edition-for-drupal-integration/"},post_type:"note",created:1525878159}},{node:{id:"50e6a339-3652-4831-a216-bace44c9cd4d",title:"My Re-Retirement From Comedy",link:null,body:{value:"<p>If the photo above of me forcing Evan to perform much of the show as a talking broom didn't make it clear, being back at ImprovBoston for the 10th anniversary of Harold Night was a blast. It was strange being back in the building at first, but once I set foot on stage it felt as if no time had passed at all. And I even had an opportunity to publicly shame my brother for his eating habits, which makes the night a success by any measure.</p> \r\n<p>Thanks to all who took in this over the top show, avoided my flailing limbs when I repeatedly climbed over audience chairs, and humored a now dad-heavy group of improvisers as they gave comedy one more spin. Being able to see so many great friends that I hadn't seen in years makes getting stuck on the red line for an hour more than worth it.</p>\r\n<p>The show was such a success that I'll once again be retiring from improv effective immediately. I'll see you all at the 20 year reunion.</p>\r\n<p>(Photo via <a href=\"https://twitter.com/haroldnight\">@haroldnight</a>. Another <a href=\"https://www.facebook.com/pg/haroldnight/photos/?tab=album&album_id=10156702164471535\">great photo set</a> is available on the Harold Night Facebook page.)</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/ac6b8c38f60653e93466f40d289d9e3a-e7e1cd8e1feccc200e98f9ff771c6717-42807.jpg",srcSet:"/static/ac6b8c38f60653e93466f40d289d9e3a-e7e1cd8e1feccc200e98f9ff771c6717-960f9.jpg 313w,\n/static/ac6b8c38f60653e93466f40d289d9e3a-e7e1cd8e1feccc200e98f9ff771c6717-c36f2.jpg 625w,\n/static/ac6b8c38f60653e93466f40d289d9e3a-e7e1cd8e1feccc200e98f9ff771c6717-42807.jpg 1250w,\n/static/ac6b8c38f60653e93466f40d289d9e3a-e7e1cd8e1feccc200e98f9ff771c6717-dbc5e.jpg 1875w,\n/static/ac6b8c38f60653e93466f40d289d9e3a-e7e1cd8e1feccc200e98f9ff771c6717-36d9f.jpg 2048w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},fields:{slug:"/post/my-re-retirement-from-comedy/"},post_type:"post",created:1525713992}},{node:{id:"5903c77b-4faf-4ef9-8757-dd6615b19040",title:"My Brief Unretirement From Comedy",link:null,body:{value:"<p>Hard to believe, but it has been years since I've been on stage doing anything resembling improv. I would have guessed that my comedy days were over for good. Well, they still are! But for one night I'm getting back on stage with some old friends at my old stomping grounds to improvise like it was 2008. Will we change the face of comedy forever?  Will we mostly talk about our kids while hanging out in the green room? Will we even be able to stay awake past 10:30 PM? <a href=\"https://www.eventbrite.com/e/hnx-harold-night-celebrates-ten-years-tickets-45323998299\">Join us</a> on Wednesday May 2, 2018 to find out.</p>"},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:2,src:"/static/55bca5feb31d2775e0ed476fc258732b-65d72acc1168e13eaddaa29339bfde83-9332f.jpg",srcSet:"/static/55bca5feb31d2775e0ed476fc258732b-65d72acc1168e13eaddaa29339bfde83-5ea23.jpg 313w,\n/static/55bca5feb31d2775e0ed476fc258732b-65d72acc1168e13eaddaa29339bfde83-8f7c3.jpg 625w,\n/static/55bca5feb31d2775e0ed476fc258732b-65d72acc1168e13eaddaa29339bfde83-9332f.jpg 800w",sizes:"(max-width: 800px) 100vw, 800px"}}}}},fields:{slug:"/post/my-brief-unretirement-from-comedy/"},post_type:"post",created:1525194488}}],pathPrefix:"",first:!1,last:!1,index:7,pageCount:12,additionalContext:{}}}}});
